<template>
	<view class="content">
		<image src="/static/images/login/top.png" style="width:187rpx ; height: 187rpx; margin: 200rpx auto 10rpx;"></image>
		<text style="margin: 10rpx auto;color: #d2d2d2;">欢迎使用智能监测</text>
		<form :model="loginForm" class="login-form">
			<view class="input-group">
				<view class="input-row border">
					<view class="title"><image src="/static/images/login/user.png" style="width: 45rpx; height: 45rpx;"></image></view>
					<input type="text" v-model="loginForm.username" placeholder="请输入账号">
				</view>
				<view class="input-row">
					<view class="title"><image src="/static/images/login/pw.png" style="width: 38rpx; height: 43rpx;"></image></view>
					<input type="text" password="true" v-model="loginForm.password" placeholder="请输入密码">
				</view>
			</view>
			<view class="btn-row">
				<button type="primary" :loading="loading" class="primary" @tap="handleLogin">登录</button>
			</view>
			<view class="action-row" style="display: none;">
				<navigator url="../register/register">注册账号</navigator>
				<text>|</text>
				<navigator url="../password/password">忘记密码</navigator>
			</view>
		</form>
	</view>
</template>

<script>
	import {
		mapState,
		mapMutations,
		mapGetters
	} from 'vuex';
	export default {
		data() {
			return {
				loading: false,
				loginForm: {
					username: "",
					password: "",
					keepPassword: false
				},
			};
		},
		computed:{
			...mapGetters(["hasLogin","hasSkip","token", "username"]),
		},
		methods: {
			onLoad() {
				/**
				if (this.token) {
					uni.reLaunch({
						url: '../../tabBar/home/index',
					});
				} 
				*/
			   this.$store.commit('SET_TOKEN',false);
			   uni.setStorageSync('token', false);
			},
			/**
			 * 登录事件
			 */
			handleLogin() {
				if (this.loading) {
					return;
				}
				/**
				 * 客户端对账号信息进行一些必要的校验。
				 * 实际开发中，根据业务需要进行处理，这里仅做示例。
				 */
				if (this.loginForm.username.length < 4) {
					uni.showToast({
						icon: 'none',
						title: '账号最短为 4 个字符'
					});
					return;
				}
				if (this.loginForm.password.length < 6) {
					uni.showToast({
						icon: 'none',
						title: '密码最短为 6 个字符'
					});
					return;
				}
				this.loading = true;
				this.$store
					.dispatch("Login", this.loginForm)
					.then(() => {
						this.loading = false;
						uni.reLaunch({
							url: '../../tabBar/home/index',
						});
					})
					.catch(() => {
						this.loading = false;
					});

			},
		}
	}
</script>

